has 'day_period_data' => (
	traits		=> ['Code'],
	is			=> 'ro',
	isa			=> 'CodeRef',
	init_arg	=> undef,
	handles		=> { call => 'execute_method' },
	default		=> sub { sub {
		# Time in hhmm format
		my ($self, $type, $time) = @_;
		SWITCH:
		for ($type) {
			if ($_ eq 'indian') {
				return 'lateEvening' if $time >= 2000
					&& $time < 2200;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'evening' if $time >= 1800
					&& $time < 2000;
				return 'weeHours' if $time >= 0000
					&& $time < 500;
				return 'afternoon' if $time >= 1500
					&& $time < 1800;
				return 'night' if $time >= 2200
					&& $time < 2400;
				return 'earlyMorning' if $time >= 500
					&& $time < 600;
				return 'noon' if $time == 1200;
				return 'midDay' if $time > 1200
					&& $time < 1500;
				return 'lateMorning' if $time >= 1000
					&& $time < 1200;
			last SWITCH;
			}
			if ($_ eq 'generic') {
				return 'lateEvening' if $time >= 2000
					&& $time < 2200;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'evening' if $time >= 1800
					&& $time < 2000;
				return 'weeHours' if $time >= 0000
					&& $time < 500;
				return 'afternoon' if $time >= 1500
					&& $time < 1800;
				return 'night' if $time >= 2200
					&& $time < 2400;
				return 'earlyMorning' if $time >= 500
					&& $time < 600;
				return 'noon' if $time == 1200;
				return 'midDay' if $time > 1200
					&& $time < 1500;
				return 'lateMorning' if $time >= 1000
					&& $time < 1200;
			last SWITCH;
			}
			if ($_ eq 'gregorian') {
				return 'lateEvening' if $time >= 2000
					&& $time < 2200;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'evening' if $time >= 1800
					&& $time < 2000;
				return 'weeHours' if $time >= 0000
					&& $time < 500;
				return 'afternoon' if $time >= 1500
					&& $time < 1800;
				return 'night' if $time >= 2200
					&& $time < 2400;
				return 'earlyMorning' if $time >= 500
					&& $time < 600;
				return 'noon' if $time == 1200;
				return 'midDay' if $time > 1200
					&& $time < 1500;
				return 'lateMorning' if $time >= 1000
					&& $time < 1200;
			last SWITCH;
			}
			if ($_ eq 'islamic') {
				return 'lateEvening' if $time >= 2000
					&& $time < 2200;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'evening' if $time >= 1800
					&& $time < 2000;
				return 'weeHours' if $time >= 0000
					&& $time < 500;
				return 'afternoon' if $time >= 1500
					&& $time < 1800;
				return 'night' if $time >= 2200
					&& $time < 2400;
				return 'earlyMorning' if $time >= 500
					&& $time < 600;
				return 'noon' if $time == 1200;
				return 'midDay' if $time > 1200
					&& $time < 1500;
				return 'lateMorning' if $time >= 1000
					&& $time < 1200;
			last SWITCH;
			}
			if ($_ eq 'hebrew') {
				return 'lateEvening' if $time >= 2000
					&& $time < 2200;
				return 'morning' if $time >= 600
					&& $time < 1000;
				return 'evening' if $time >= 1800
					&& $time < 2000;
				return 'weeHours' if $time >= 0000
					&& $time < 500;
				return 'afternoon' if $time >= 1500
					&& $time < 1800;
				return 'night' if $time >= 2200
					&& $time < 2400;
				return 'earlyMorning' if $time >= 500
					&& $time < 600;
				return 'noon' if $time == 1200;
				return 'midDay' if $time > 1200
					&& $time < 1500;
				return 'lateMorning' if $time >= 1000
					&& $time < 1200;
			last SWITCH;
			}
		}
	} },
);

